declare const SQL_QUERY = "\nUPDATE OR IGNORE Vote SET\n  \"method\" = IFNULL(@method, \"method\"), \"party\" = IFNULL(@party, \"party\"), \"issued\" = IFNULL(@issued, \"issued\"), \"returned\" = IFNULL(@returned, \"returned\"), \"counted\" = IFNULL(@counted, \"counted\"), \"personId\" = IFNULL(@personId, \"personId\"), \"electionId\" = IFNULL(@electionId, \"electionId\")\nWHERE\n  \"personId\" = @personId AND \"electionId\" = @electionId\n";
export default SQL_QUERY;
